uthModule -->\n\nNbRegisterComponent->NbAuthModule\n\n\n\n\n\nNbRequestPasswordComponent\n\nNbRequestPasswordComponent\n\nNbAuthModule -->\n\nNbRequestPasswordComponent->NbAuthModule\n\n\n\n\n\nNbResetPasswordComponent\n\nNbResetPasswordComponent\n\nNbAuthModule -->\n\nNbResetPasswordComponent->NbAuthModule\n\n\n\n\n\nNbLogoutComponent\n\nNbLogoutComponent\n\nNbAuthModule -->\n\nNbLogoutComponent->NbAuthModule\n\n\n\n\n\nNbAuthComponent \n\nNbAuthComponent \n\nNbAuthComponent  -->\n\nNbAuthModule->NbAuthComponent \n\n\n\n\n\nNbAuthBlockComponent \n\nNbAuthBlockComponent \n\nNbAuthBlockComponent  -->\n\nNbAuthModule->NbAuthBlockComponent \n\n\n\n\n\nNbLoginComponent \n\nNbLoginComponent \n\nNbLoginComponent  -->\n\nNbAuthModule->NbLoginComponent \n\n\n\n\n\nNbRegisterComponent \n\nNbRegisterComponent \n\nNbRegisterComponent  -->\n\nNbAuthModule->NbRegisterComponent \n\n\n\n\n\nNbRequestPasswordComponent \n\nNbRequestPasswordComponent \n\nNbRequestPasswordComponent  -->\n\nNbAuthModule->NbRequestPasswordComponent \n\n\n\n\n\nNbResetPasswordComponent \n\nNbResetPasswordComponent \n\nNbResetPasswordComponent  -->\n\nNbAuthModule->NbResetPasswordComponent \n\n\n\n\n\nNbLogoutComponent \n\nNbLogoutComponent \n\nNbLogoutComponent  -->\n\nNbAuthModule->NbLogoutComponent \n\n\n\n\n\n\n          \n          \n          \n              Zoom in\n              Reset\n              Zoom out\n          \n      \n      \n      \n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            app/@theme/components/auth/auth.module.ts\n        \n\n\n        \n\n        \n            \n                \n                    Declarations\n                    \n                            \n                                NbAuthComponent\n                            \n                            \n                                NbAuthBlockComponent\n                            \n                            \n                                NbLoginComponent\n                            \n                            \n                                NbRegisterComponent\n                            \n                            \n                                NbRequestPasswordComponent\n                            \n                            \n                                NbResetPasswordComponent\n                            \n                            \n                                NbLogoutComponent\n                            \n                    \n                \n                \n                    Exports\n                    \n                            \n                                    NbAuthComponent\n                            \n                            \n                                    NbAuthBlockComponent\n                            \n                            \n                                    NbLoginComponent\n                            \n                            \n                                    NbRegisterComponent\n                            \n                            \n                                    NbRequestPasswordComponent\n                            \n                            \n                                    NbResetPasswordComponent\n                            \n                            \n                                    NbLogoutComponent\n                            \n                    \n                \n            \n        \n    \n\n\n    \n        import { Injector, ModuleWithProviders, NgModule } from '@angular/core';\nimport { CommonModule } from '@angular/common';\nimport { RouterModule } from '@angular/router';\nimport { FormsModule } from '@angular/forms';\nimport { HttpClientModule } from '@angular/common/http';\n\nimport { NbLayoutModule, NbCardModule, NbCheckboxModule } from '@nebular/theme';\n\nimport { NbAuthService } from './services/auth.service';\nimport { NbDummyAuthProvider } from './providers/dummy-auth.provider';\nimport { NbEmailPassAuthProvider } from './providers/email-pass-auth.provider';\n\nimport {\n  defaultSettings,\n  NB_AUTH_USER_OPTIONS_TOKEN,\n  NB_AUTH_OPTIONS_TOKEN,\n  NB_AUTH_PROVIDERS_TOKEN,\n  NB_AUTH_TOKEN_WRAPPER_TOKEN,\n  NbAuthOptions, NB_AUTH_INTERCEPTOR_HEADER,\n} from './auth.options';\n\nimport { NbAuthComponent } from './components/auth.component';\nimport { NbAuthSimpleToken, NbTokenService } from './services/token.service';\n\nimport { NbAuthBlockComponent } from './components/auth-block/auth-block.component';\nimport { NbLoginComponent } from './components/login/login.component';\nimport { NbRegisterComponent } from './components/register/register.component';\nimport { NbLogoutComponent } from './components/logout/logout.component';\nimport { NbRequestPasswordComponent } from './components/request-password/request-password.component';\nimport { NbResetPasswordComponent } from './components/reset-password/reset-password.component';\nimport { ToasterModule, ToasterService, ToasterConfig, Toast, BodyOutputType } from 'angular2-toaster';\n\nimport { routes } from './auth.routes';\nimport { deepExtend } from './helpers';\n\nexport function nbAuthServiceFactory(config: any, tokenService: NbTokenService, injector: Injector) {\n  const providers = config.providers || {};\n\n  for (const key in providers) {\n    if (providers.hasOwnProperty(key)) {\n      const provider = providers[key];\n      const object = injector.get(provider.service);\n      object.setConfig(provider.config || {});\n    }\n  }\n\n  return new NbAuthService(tokenService, injector, providers);\n}\n\nexport function nbOptionsFactory(options) {\n  return deepExtend(defaultSettings, options);\n}\n\n@NgModule({\n  imports: [\n    CommonModule,\n    NbLayoutModule,\n    NbCardModule,\n    NbCheckboxModule,\n    RouterModule.forChild(routes),\n    FormsModule,\n    HttpClientModule,\n    ToasterModule,\n  ],\n  declarations: [\n    NbAuthComponent,\n    NbAuthBlockComponent,\n    NbLoginComponent,\n    NbRegisterComponent,\n    NbRequestPasswordComponent,\n    NbResetPasswordComponent,\n    NbLogoutComponent,\n  ],\n  exports: [\n    NbAuthComponent,\n    NbAuthBlockComponent,\n    NbLoginComponent,\n    NbRegisterComponent,\n    NbRequestPasswordComponent,\n    NbResetPasswordComponent,\n    NbLogoutComponent,\n  ],\n  providers: [\n    ToasterService,\n  ],\n})\nexport class NbAuthModule {\n  static forRoot(nbAuthOptions?: NbAuthOptions): ModuleWithProviders {\n    return  {\n      ngModule: NbAuthModule,\n      providers: [\n        { provide: NB_AUTH_USER_OPTIONS_TOKEN, useValue: nbAuthOptions },\n        { provide: NB_AUTH_OPTIONS_TOKEN, useFactory: nbOptionsFactory, deps: [NB_AUTH_USER_OPTIONS_TOKEN] },\n        { provide: NB_AUTH_PROVIDERS_TOKEN, useValue: {} },\n        { provide: NB_AUTH_TOKEN_WRAPPER_TOKEN, useClass: NbAuthSimpleToken },\n        { provide: NB_AUTH_INTERCEPTOR_HEADER, useValue: 'Authorization' },\n        {\n          provide: NbAuthService,\n          useFactory: nbAuthServiceFactory,\n          deps: [NB_AUTH_OPTIONS_TOKEN, NbTokenService, Injector],\n        },\n        NbTokenService,\n        NbDummyAuthProvider,\n        NbEmailPassAuthProvider,\n      ],\n    };\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules/PagesModule.html":{"url":"modules/PagesModule.html","title":"module - PagesModule","body":"\n                   \n\n\n\n\n  Modules\n  PagesModule\n\n\n      \n          \n              \n\n\n\n\n\ndependencies\n\nLegend\n\n Declarations\n\n Module\n\n Bootstrap\n\n Providers\n\n Exports\n\ncluster_PagesModule\n\n\n\ncluster_PagesModule_declarations\n\n\n\ncluster_PagesModule_imports\n\n\n\n\nPagesComponent\n\nPagesComponent\n\n\n\nPagesModule\n\nPagesModule\n\nPagesModule -->\n\nPagesComponent->PagesModule\n\n\n\n\n\nPagesRoutingModule\n\